import { HttpClient } from '@angular/common/http';
import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { ApiServiceService } from '../api-service.service';
import { Recipe } from '../model/recipe';
import { Category } from '../model/category';
import { MatDialog } from '@angular/material/dialog';
import { CreateRecipeComponent } from '../create-recipe/create-recipe.component';
import {MatDialogModule} from '@angular/material/dialog';
import {MatFormFieldModule} from '@angular/material/form-field';

@Component({
  selector: 'app-recipe-catalog',
  templateUrl: './recipe-catalog.component.html',
  styleUrls: ['./recipe-catalog.component.css']
})
export class RecipeCatalogComponent implements OnInit {

  recipes: Recipe[]=[{
    id: 0,
    title: '',
    categoryId: '',
    ingredients: [{
        quantity: 0,
        name: '',
        ingredient: ''
    }],
    instructions: [''],
    nutritional_information: {
      calories: '',
        protein: '',
        carbohydrates: '',
        fat: ''
    },
    img: '',
    creationDate: undefined!,
    creatorId: 0
  }]

  filteredList: Recipe[]=[{
    id: 0,
    title: '',
    categoryId: '',
    ingredients: [{
        quantity: 0,
        name: '',
        ingredient: ''
    }],
    instructions: [''],
    nutritional_information: {
      calories: '',
        protein: '',
        carbohydrates: '',
        fat: ''
    },
    img: '',
    creationDate: undefined!,
    creatorId: 0
  }]

  constructor(private http: HttpClient, public dialog: MatDialog,private api: ApiServiceService, private router:Router) {
      // this.recipeList = this.recipes;
   }

  ngOnInit() {
    this.http.get<any>('http://localhost:5999/recipes').subscribe(res=>{
      this.recipes = res
    })

  }

  condition = false
  filterResultsByName(text: string) {
    if (!text) {
      this.filteredList = this.recipes;
    }

    this.filteredList = this.recipes.filter(
      data => data.title.toLowerCase() === text.toLowerCase()
    ); 
    this.condition=true
  }

  cat: string = ""

  filterResultsByCat() {
    if (!this.cat) {
      console.log("works")
      this.filteredList = this.recipes;
    }

    this.filteredList = this.recipes.filter(
      data => data.categoryId.toLowerCase() === this.cat.toLowerCase()
    );
    this.condition = true
  }

  onCreate(){
    this.dialog.open(CreateRecipeComponent, {
      width: '80%',
      maxWidth: '100%'
    });
  }

}
<div class="row recipe-header d-flex">
    <form class="form-inline mx-2 my-0" id="SearchForm">

        <div class="input-group-append">
            <input class="form-control input-group-lg p-4 mx-2" type="search" name="search" autocomplete="off" placeholder="Search for a recipe by name, ingredients or category" #search>
            <button mat-button class="btn" (click)="filterResultsByName(search.value)"><i class="bi bi-search"></i></button>
        </div>

    </form>


    <mat-form-field class="filter">
        <mat-label>Filter by Category</mat-label>
        <select matNativeControl required [(ngModel)]="cat" (change)="filterResultsByCat()">
          <option value="1">Indian Cuisine</option>
          <option value="2">Breakfast</option>
          <option value="3">Beverages</option>
          <option value="4">Dessert</option>
        </select>
      </mat-form-field>

      <div class="btn">
        <button mat-button class="create-btn"(click)="onCreate()">Create Recipe</button>
    </div>

</div>

<div class="mx-2 my-5" *ngIf="condition">
    <app-filter [item]="filteredList"></app-filter>
  </div>

  <div class="mx-2 my-5" *ngIf="!condition">
    <app-filter [item]="recipes"></app-filter>
  </div>
